import React from "react";
import "./App.css";
import TodoItems from "./components/TodoItem";

class App extends React.Component {
  constructor() {
    super();
    this.TodoItems = ["Get to work", "Go home", "Self study at home"];
  }
  render() {
    return (
      <div className="App">
        {this.TodoItems.map(item => (
          <TodoItems />
        ))}
        <TodoItems title="Get to work" />
        <TodoItems title="Go home" />
        <TodoItems title="Self study at home" />
      </div>
    );
  }
}

export default App;
